import React from 'react'
import { useState } from 'react'
import axios from 'axios'
import { useEffect } from 'react'

const Adminpage = () => {
  const [details, setDetails] = useState([])
  useEffect(() => {
    axios.get('http://localhost:5001/auth/message').then((response) => {
      console.log(response.data)
      setDetails(response.data)
    })

  }, [])
  return (
    <div className='flex justify-center'>
      <div className='container flex justify-center pt-10 '>
        <table class="table border text-white">
          <thead className='border'>
            <tr>
              <th className='border mx-5'>Name</th>
              <th className='border mx-5'>Message</th>
              <th className='border mx-5'>Date</th>
            </tr>
          </thead>
          <tbody>
            {details.map((data) => {
              return (
                <>
                  <tr>
                    <td className='border px-5 py-2 w-40'>{data.username} </td>
                    <td className='border px-5 pw-2/4'>{data.message}</td>
                    <td className='border px-5 py-2'>{data.date}</td>
                  </tr>
                </>
              )
            })}
          </tbody>
        </table>
      </div>
    </div>
  )
}

export default Adminpage
